    <script type="text/javascript">
        function formatComplex(re, im) {
            if (im < 0) {
                return `${re} - ${-im}i`
            } else {
                return `${re} + ${im}i`
            }
        }

        function makeText(x, y, z) {
            var text = [];
            for (var i = 0; i < x.length; i++) {
                var row = [];
                for (var j = 0; j < y.length; j++) {
                    row.push(`z = ${formatComplex(y[j],x[i])}`);
                    // row.push("&#948; : " + d3.format(".4S")(x[i]) + "<br> &#963; : " + d3.format(".4S")(y[j]) +
                    //     "<br> p : " + d3.format(".4S")(z[i][j]));
                }
                text.push(row);
            }
            return text;
        }
    </script>
